import React from "react"
import ReactDOM from "react-dom/client"
import { createBrowserRouter, RouterProvider } from "react-router-dom"
import { AuthProvider } from "./contexts/Auth"
import Navbar from "./components/Navbar"
import ProtectedRoute from "./components/ProtectedRoute"
import Home from "./pages/Home"
import Recipes from "./pages/Recipes"
import RecipeDetails from "./pages/RecipeDetails"
import MealPlanner from "./pages/MealPlanner"
import Profile from "./pages/Profile"
import Login from "./pages/Login"
import Register from "./pages/Register"
import "./contexts/style.css"

const Layout = ({ children }) => (
  <AuthProvider>
    <div className="App">
      <Navbar />
      <main>{children}</main>
    </div>
  </AuthProvider>
)

const router = createBrowserRouter([
  {
    path: "/",
    element: <Layout><Home /></Layout>,
  },
  {
    path: "/recipes",
    element: <Layout><Recipes /></Layout>,
  },
  {
    path: "/recipes/:id",
    element: <Layout><RecipeDetails /></Layout>,
  },
  {
    path: "/login",
    element: <Layout><Login /></Layout>,
  },
  {
    path: "/register",
    element: <Layout><Register /></Layout>,
  },
  {
    path: "/meal-planner",
    element: <Layout><ProtectedRoute><MealPlanner /></ProtectedRoute></Layout>,
  },
  {
    path: "/profile",
    element: <Layout><ProtectedRoute><Profile /></ProtectedRoute></Layout>,
  },
], {
  future: {
    v7_startTransition: true,
    v7_relativeSplatPath: true,
  },
})

const root = ReactDOM.createRoot(document.getElementById("root"))
root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
)
